The Sonic Squirrels 2930 robotics team is part of <a href="https://www.firstinspires.org/">FIRST Robotics</a>, which combines the excitement of competitive sports with the tremendous opportunities to develop STEM skills under the guidance of professional engineering and business volunteer mentors. Our team fosters well-rounded life capabilities including self-confidence, communication, and leadership. Students on our team learn and apply vital workforce skills, including, engineering, programming, computer-aided drafting and design, marketing , graphic design, website development, business planning, and fundraising skills. Our team designs and builds robots based on an annually themed challenge under strict rules, limited resources, and tight time constraints. In the off season, we spend time in the community working with others at STEM related events.
<h1>Our Mission Statement: Have Fun! Build Fun! &nbsp; Be Fun! &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</h1>
<strong>Have Fun:</strong>Have fun learning, teaching, and experiencing. &nbsp;

<strong>Build Fun:</strong> Build up other teams and a good working environment in which we build a robot as well as many other aspects of our team. &nbsp;

<strong>Be Fun: </strong>Be fun and spirited people<em>.</em> &nbsp;
